  JWILLIAMS, Thomas Sydney and WILLIAMS, Agnes Lydia
  JWILLIAMS, Rachel Millicent and REED, Alfred Vincent Standish
  JREED, Richard Sydney and MURPHY, Elizabeth Muriel
  VREED, Jeremy William and BENNETT, Nicola Josephine
  REED, Jeremy William and BENNETT, Nicola Josephine (cont...)
  William has spent time in Australia, Canada and North America. He moved to England in the early
  1980's and joined the Findhorn Foundation at Inverness, Scotland. Later he moved to the Isle of
  Erriad to a smaller offshoot community. He now lives near Cheltenham and is studying landscape
  architecture.
  Nicola was educated at Putney High School, London and Girton College, Cambridge. She lived in
  London and worked in museums and galleries and for the Arts Council of Great Britain as an art
  exhibition organiser before moving to Erriad. She is now organising the Cheltenham Festival of
  Literature.
